State files a 2nd Amended Information charging Possession of THC - 2nd and subsequent offense.  
No contest plea to the amended charge.  Convicted.  Sentence is withheld.  Defendant is placed on probation to DOC for two (2) years.  Conditions of probation are:
1) Defendant is to have no contact with drug users or dealers;
2) Assessment/treatment/counseling as deemed appropriate by the Department's assessment process;
3) Spend thirty (30) days in jail, under the Huber Law, to commence on 10-16-14 by 6:00 p.m.  
4) Pay cost of action; 
5) Provide DNA sample and pay the surcharge;
6) Pay supervision fees in an amount to be determined by DOC.  
Plea Questionnaire/Waiver of Rights. 
Notice of Right to Seek Postconviction Relief. 
Voter Ineligibility Notice and Acknowledgment.
